function MessageBar() {
  return(
    <form>
      <input type = "text" placeholder = "Enter text here..."/>
    </form>
  );
}

function RoomName({name}){
  return(
    <p>{name}</p>
  );
}

function RoomsList({ rooms }){
  const rows = [];

  rooms.forEach((room) => {
    rows.push(
      <RoomName name = {rooms.name} />
    );
  });

  return(
    <ul>
      {rooms[0].name}
    </ul>
  );
}

const ROOMS = [
  {name: "fun"},
  {name: "yoga"}
];

function CurrentRoom() {
  return (
    <div id = "room">
      <h1>hi!</h1>
      <MessageBar />
      <RoomsList rooms = { ROOMS } />

    </div>
  );
}

export default function App() {
  return <CurrentRoom />;
}
